pub enum Body {
    None,
    Empty,
    Bytes(Bytes),
    Message(Box<dyn MessageBody + Unpin>),
}

type TunnelFuture: Future<
        Output = Result<(ResponseHead, Framed<Self::Io, ClientCodec>), SendRequestError>,
    >;

pub enum InvalidUrl {
    MissingScheme,
    UnknownScheme,
    MissingHost,
    HttpError(http::Error),
}

pub enum ContentRangeSpec {
    Bytes {
        range: Option<(u64, u64)>,
        instance_length: Option<u64>,
    },
    Unregistered {
        unit: String,
        resp: String,
    },
}

pub enum RequestHeadType {
    Owned(RequestHead),
    Rc(Rc<RequestHead>, Option<HeaderMap>),
}

pub enum Payload<S = PayloadStream> {
    None,
    H1(crate::h1::Payload),
    H2(crate::h2::Payload),
    Stream(S),
}

pub enum Item {
    FirstText(Bytes),
    FirstBinary(Bytes),
    Continue(Bytes),
    Last(Bytes),
}
